Had no idea what to expect when attending the 6th year anniversary of @thecapehotel - safe to say my expectations were blown out of the water.  The #switchinggears event was all about trying new things, exploring the greater Cabo San Lucas area, and spending time with 28 other people who all had radically different professions and connections to this place. Being thrown out of your comfort zone and in to someone else’s is an incredible way to learn.  Thank you for facilitating such an awesome experience 
